import React from "react";
import ReactDOM from "react-dom/client";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import "./index.css";
import App from "./App";
import GroupsList from "./pages/GroupsList"; // ✅ Import the Groups Page

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <Router>
      <Routes>
        <Route path="/" element={<App />} />
        <Route path="/groups" element={<GroupsList />} /> {/* ✅ Ensure this exists */}
      </Routes>
    </Router>
  </React.StrictMode>
);
